import React from "react";
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableContainer from '@material-ui/core/TableContainer';
import TableRow from '@material-ui/core/TableRow';

const MapLegend = (props) => {
	const { imgInfo } = props;
	const { levels, cmap } = imgInfo;

	let color_styles = [];
	cmap.forEach((color) => {
		color_styles.push( {width: "1em", backgroundColor: color, opacity: "0.8"} );
	})

	return (
		<TableContainer>
			<Table size="small" padding="none" aria-label="color table">
				<TableBody>
					<TableRow key="first">
						<TableCell style={color_styles[0]}></TableCell>
						<TableCell align="center" style={{width:"8em"}}>&lt;{levels[0]}</TableCell> 
					</TableRow>
					{levels.map((lvl, i) => (
						<TableRow key={i}>
							<TableCell style={color_styles[i+1]}></TableCell>
							{levels[i+1] ?
								<TableCell align="center" style={{width:"8em"}}>{levels[i]} to {levels[i+1]}</TableCell>
							:
								<TableCell align="center" style={{width:"8em"}}>&ge;{levels[i]}</TableCell>
							}
						</TableRow>
					))}
				</TableBody>
			</Table>
		</TableContainer>
	);
}

export default MapLegend;
